import React from 'react';

const App = () =>{
  const newTime = new Date().toLocaleTimeString();


  return(
    <>
      <div>
        <h1> {newTime} </h1>
        <button onClick={newTime}> Get Time </button>
      </div>
    </>
  )
}

export default App;
